byte[] ConvertUrlToByteArray(string url)
{
    using (WebClient webClient = new WebClient())
    {
        try
        {
            byte[] imageBytes = webClient.DownloadData(url);
            return imageBytes;
        }
        catch (Exception ex)
        {
            return null;
        }
    }
}